# DP
# dp[i][j] = length of solution of t[:i] and s[:j] containing s[j-1]
# i: from 1 to len(t)
# j: from 1 to len(s)

# e.g.
# "xxabcde"
# "ae"

# dp[1][1] = float('inf')
# dp[1][2] = float('inf')
# dp[1][3] = 1
# dp[1][4] = 2
# ...
# dp[1][6] = 4            # don't know where's the head, but know where's the tail
# dp[1][7] = 5

# dp[2][1] = float('inf')
# dp[2][2] = float('inf')
# dp[2][3] = float('inf')
# dp[2][4] = float('inf')
# dp[2][6] = float('inf')
# dp[2][7] = 4+1 = 5


# TLE on submission due to new cases, but will pass on individual test.

class Solution:
    def minWindow(self, s1: str, s2: str) -> str:
        M, N = len(s1), len(s2)
        dp = [[ float('inf') for _ in range(M+1) ] for _ in range(N+1)]

        for i in range(1,N+1):            # start from shorter s2
            for j in range(1,M+1):
                if s1[j-1] == s2[i-1]:
                    if i == 1:
                        dp[i][j] = 1
                    else:
                        dp[i][j] = dp[i-1][j-1]+1
                else:
                    dp[i][j] = dp[i][j-1]+1
            
        d = min(dp[-1])
        if d == float('inf'):
            return ''
        for i in range(1,M+1):
            if dp[-1][i] == d:
                return s1[i-d:i]

print(Solution().minWindow("cnhczmccqouqadqtmjjzl","mm"))
print(Solution().minWindow( "abcdebdde", "bde"))
print(Solution().minWindow("","aafexpporasshttkzccdxx"))